2. Средний уровень (уровень текущего хранения) - данный уровень представляет собой буферную базу данных;
3. Верхний уровень (уровень архивного хранения) – сбор и хранение информации.
Параметры, передаваемые в локальную вычислительную сеть в формате стандарта ОРС, включают в себя:
